schema:
{
 "description": "ApplicationVersion is the Schema for the applicationversions API",
 "properties": {
  "spec": {
   "description": "ApplicationVersionSpec defines the desired state of ApplicationVersion",
   "properties": {
    "appType": {
     "type": "string"
    },
    "created": {
     "format": "date-time",
     "type": "string"
    },
    "description": {
     "additionalProperties": {
      "type": "string"
     },
     "type": "object"
    },
    "digest": {
     "type": "string"
    },
    "displayName": {
     "additionalProperties": {
      "type": "string"
     },
     "type": "object"
    },
    "home": {
     "type": "string"
    },
    "icon": {
     "type": "string"
    },
    "maintainer": {
     "items": {
      "description": "Maintainer describes a Chart maintainer.",
      "properties": {
       "email": {
        "description": "Email is an optional email address to contact the named maintainer",
        "type": "string"
       },
       "name": {
        "description": "Name is a user name or organization name",
        "type": "string"
       },
       "url": {
        "description": "URL is an optional URL to an address for the named maintainer",
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "sources": {
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "version": {
     "type": "string"
    }
   },
   "required": [
    "displayName",
    "version"
   ],
   "type": "object"
  }
 },
 "title": "Application Version",
 "type": "object"
}
